import React from 'react';
import Navigator from './tag/navigator';

const Header = () => {
  return (
    <header>
      <nav>
        <a href="#t">Movies</a>
        <a href="#t">Series</a>
        <a href="#t">Cartoons</a>
        <a href="#t">Anime</a>
      </nav>
    </header>
  );
};

export default Header;
